import { Component, OnInit } from '@angular/core';
import { FudbalskitimService } from './services/fudbalskitim.service';
import *

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  constructor(private fudbalskitimService: FudbalskitimService) {
    const timID = this.trenutniTimID; // Pretpostavljam da negde definisane trenutniTimID

    this.fudbalskitimService.loadTimById(timID);
    this.fudbalskitimService.loadIgraciZamena(timID);
    this.fudbalskitimService.loadIgraciTeren(timID);
    this.fudbalskitimService.loadGolmani(timID);
    this.fudbalskitimService.loadOdbrambeni(timID);
    this.fudbalskitimService.loadVeznjaci(timID);
    this.fudbalskitimService.loadNapadaci(timID);
  }
  title = 'AngularProjekat';
}
